define('baseVM',['knockout','plugins/router','untilRE','photoswipeRE/photoswipe-ui-default.min', 'photoswipeRE/photoswipe.min'],
function (ko,router,ut,PhotoSwipeUI_Default, PhotoSwipe) {

    return function () {
        var self = this;
        this.model = {
            title: '我的审批',
            subTitle: '已审批',
            data: ko.observableArray(),
            vacationCategory: [],
            selectedCategory: '',
            inputVal: ko.observable(''),
            pageIndex: 0,
            noMore: false,
            isLoading:false,
            pageMark:ko.observable(''),//总页数
            isActivated:false
        }

        this.activate = function (e) {

            //配置所有类型
            var allVacationCategory = ['全部'];
            allVacationCategory = allVacationCategory.concat(appConfig.app.vacationCategory)
            self.model.vacationCategory = ko.observable(allVacationCategory);
            self.model.selectedCategory = ko.observable(allVacationCategory[0])


            self.getData(1);

            // self.model.isActivated = true;
        }

        this.attached = function () {

        }


        this.deactivate = function () {
            
        }

        this.init = function () {
            self.model.noMore = false;
            self.model.pageIndex = 0;
            self.model.data([]);
        }

        //附件
        this.showAttach = function (index) {
            index = index();
            var tmpData = self.model.data()[index];

            var imgUrlArr = [tmpData.C3_541450276993, tmpData.C3_545771156108, tmpData.C3_545771157350, tmpData.C3_545771158420];
            attachShow(imgUrlArr, PhotoSwipe, PhotoSwipeUI_Default);
        }

        //类型筛选
        this.categoryFilterClick = function (index) {
            self.model.selectedCategory(self.model.vacationCategory()[index()]);
            self.getData(0);
        }

        this.goToApplyDetailPage = function (index) {
            var tmpData = self.model.data()[index()];
            globSingleData = JSON.stringify(tmpData);
            router.navigate("#applyDetail");
        }

        this.kvoInput = function () {
            self.model.pageIndex = 0;
            self.getData(0);
        }

        this.pageUp = function () {
            if(self.model.isLoading) {console.log("loading"); return;};//判断当前是否处于加载数据中 
            if (self.model.pageIndex <= 0){ self.model.pageIndex = 0 ; return}
            else self.model.pageIndex--;
            self.getData(1);
        }

        this.pageDown = function () {
            if(self.model.isLoading) {console.log("loading"); return;}//判断当前是否处于加载数据中 
            if (self.model.noMore) return;
            self.model.pageIndex++;
            self.getData(1);
        }

        this.pageFirst = function(){
             self.model.pageIndex = 0;
             self.getData(0);
        }

        this.setPageMark = function(param,data){
            var pageMarkIndex =  param.pageIndex + 1;
            var pageMarkTotal = Math.ceil(parseInt(data.total) / param.pageSize);
            if(pageMarkTotal == 0) pageMarkIndex = 0;
            self.model.pageMark(pageMarkIndex + "/" + pageMarkTotal);
        }

        this.setPageMarkWithNum = function(index,total){
            self.model.pageMark(index + "/" + total);
        }

    }

});
define('main/viewmodels/applying',['durandal/app',
    'knockout',
    'plugins/router',
    'httpServiceRE',
    'components/headerCpt',
    'components/cellMainCpt',
    'untilRE',
    'photoswipeRE/photoswipe-ui-default.min',
    'photoswipeRE/photoswipe.min',
    'baseVM',"durandal/viewEngine"],
    function (app, ko, router, httpService, hCpt, cellCpt, ut, PhotoSwipeUI_Default, PhotoSwipe, baseVM,viewEngine) {
        var selfVM = new baseVM();
        selfVM.model.subTitle = '申请中'
        var self = selfVM;

        //获取数据
        selfVM.getData = function (type) {
            selfVM.model.isLoading = true;
            var keyStr = '';
            keyStr = self.model.selectedCategory();
            keyStr = keyStr == '全部' ? '' : keyStr;

            var param = {
                'subresid': '',
                'cmswhere': '',
                'key': keyStr
            }


            param.pageSize = 10;
            if (!type) {//刷新
                param.pageIndex = 0;

            } else {//加载
                param.pageIndex = self.model.pageIndex;
            }



            httpService.getApplyingData(param, function (data) {

                if (data && data.data) {
                    var dataArr = data.data;
                    self.model.data(dataArr);

                     //设置页标（base中）
                    self.setPageMark(param,data);

                    if (dataArr.length < param.pageSize) self.model.noMore = true;
                    else self.model.noMore = false;


                } else {
                    // self.setData({ data: [] });
                    // self.setData({ noMore: true });
                }
                selfVM.model.isLoading = false;
            }, function () {
                selfVM.model.isLoading = false;
            });
        }
        selfVM.goToAddApplying = function () {
            router.navigate("#addApply");
        }

        selfVM.goToEditPage = function (index) {
            index = index();
            var tmpData = self.model.data()[index];
            // router.navigate("#addApply?data=" + JSON.stringify(tmpData));

            globSingleData = JSON.stringify(tmpData);
            router.navigate("#addApply");
        }

        selfVM.goToApplyDetailPage = function (index) {
                var tmpData = self.model.data()[index()];
                // var tmpJsonData = JSON.stringify(tmpData);
                // router.navigate("#applyDetail?data=" + tmpJsonData + '&willCancel=true');

                globSingleData = JSON.stringify(tmpData);
                router.navigate("#applyDetail?willCancel=true");
            }

        //提交
        selfVM.submit = function (index) {
            index = index()
            var tmpData = self.model.data()[index];
            tmpData.C3_541449538456 = "Y"

            var param = {
                'data': tmpData
            }

            httpService.saveApply(param, function (resData) {
                if (resData.error == 0 && resData && resData.data && resData.data[0]) {
                    cmAlert("");
                    var returnData = resData.data[0];
                    self.model.data()[index] = returnData;
                    self.model.data(self.model.data());
                } else {
                    cmAlert("error");
                }

            }, function () {

            });
        }
        return selfVM
    }); 



  //筛选出请假规则
  function getRule(str) {
    var ruleArr = appConfig.app.rule;
    for (var i = 0; i < ruleArr.length; i++) {
      var tempRuleM = ruleArr[i];
      if (tempRuleM.C3_533402301362 == str) {
        return tempRuleM.C3_545771115865

      }
    }
    return '';
  }

  //筛选出那一条请假规则
  function getVactionObject(str) {
    var ruleArr = appConfig.app.rule;
    for (var i = 0; i < ruleArr.length; i++) {
      var tempRuleM = ruleArr[i];
      if (tempRuleM.C3_533402301362 == str) {
        return tempRuleM

      }
    }
    return null;
  }

  //获取所有请假类型
  function getAllRuleCategory() {
    var ruleArr = Array.from(appConfig.app.rule);
    var dataArr = ['全部'];
    for (var i = 0; i < ruleArr.length; i++) {
      var tempRuleM = ruleArr[i];
      dataArr.push(tempRuleM.C3_533402301362);
    }
    return dataArr;
  }

  //获取照片非必填
  function getCarmeShow(selectRuleM) {//附件
    if (selectRuleM == null) return ["", "", "", ""];
    var imgShowArr = [];//拍照是否显示
    imgShowArr.push([selectRuleM.C3_545770918237 == 'Y' ? true : false, selectRuleM.C3_545770982165 == 'Y' ? "必填" : "非必填", selectRuleM.C3_545771032511]);
    imgShowArr.push([selectRuleM.C3_545770921226 == 'Y' ? true : false, selectRuleM.C3_545770982361 == 'Y' ? "必填" : "非必填", selectRuleM.C3_545771032706]);
    imgShowArr.push([selectRuleM.C3_545770922361 == 'Y' ? true : false, selectRuleM.C3_545770982566 == 'Y' ? "必填" : "非必填", selectRuleM.C3_545771032913]);
    imgShowArr.push([selectRuleM.C3_545770923478 == 'Y' ? true : false, selectRuleM.C3_545770990395 == 'Y' ? "必填" : "非必填", selectRuleM.C3_545771067208]);
    return imgShowArr;
  }

  var common = {
    getRule: getRule,
    getVactionObject: getVactionObject,
    getAllRuleCategory: getAllRuleCategory,
    getCarmeShow: getCarmeShow
  }
;
